import React from 'react'
import { Button, Container, Row, Form } from 'react-bootstrap';

function Newissue() {
    return (
        <Container>
            <Form>
                <hr />
                <Row>
                    <h2>New Issue</h2>
                </Row>
                <hr />
            </Form>
        </Container>
    )
}

export default Newissue
